function writeHtml(fileName, originalHtml, modifiedHtml, diffResult) {
    let finalContent = [
        '<html><head>', style, '</head><body>',
        '<h1>Original Html String</h1>',
        EscapeHtml(originalHtml),
        '<h1>Modified Html String</h1>',
        EscapeHtml(modifiedHtml),
        '<h1>Result</h1>',
        diffResult,
        '</body></html>'].join('');
    fs.writeFile("./dist/" + fileName + '.html', finalContent, function(err) {
        if(err) {
            return console.log(err);
        }
        console.log("The file was saved!");
    });
}
